import { useContext, useEffect } from 'react';
import { ContentPage, ContentPageContext } from '../styled/Components';
import { useRouteMatch } from 'react-router-dom';
const UserList = (props: any) => {
	const contentPageContext = useContext(ContentPageContext);
	const { url } = useRouteMatch();
	useEffect(() => {
		const list = contentPageContext.getLocationList();
		contentPageContext.setLocationList([...list, { title: "User listl", url: url }]);
	});
	return (
		<div>
			<h2>User list</h2>
		</div>
	);
}

export default UserList;
